import React from 'react';

function App() {
  return (<div className='container'>
    <nav>
      <div className='logo'><img src='/img/logo.png'></img></div>
      <div className='navItems'><ul>
        <li>My assignment</li>
        <li>Chat with Mentor</li>
        <li className='activ'>ProfileName</li>
      </ul></div>
    </nav>
  </div>
  );
}

export default App;
